VALUES ('3222476760371', '20 Mini Canapés', 'Canapé fromage de chèvre et poivrons grillés sur pain de mie nature 29,6% : pain de mie nature 33,2%* (farine de _blé_ - eau - sirop de sucre inverti - _beurre_ - _œuf_ entier en poudre - levure - _lait_ écrémé en poudre - sel - sucre - farine de _blé_ malté - _gluten de blé_ - huile de tournesol) - _fromage de chèvre_ 32,7%* - poivrons rouges et jaunes grillés 22,4%* - _lait_ demi-écrémé - huile de colza - huile de tournesol - sel - amidon transformé de pomme de terre - ail - origan - acidifiant : acide citrique. *Pourcentages exprimés sur le canapé fromage de chèvre et poivrons grillés.  Mini blini tzatziki et saumon fumé 26,7% : mini blini 49,3%* (_lait_ demi-écrémé - farine de _blé_ - eau - huile de colza - _œuf_ entier en poudre - sucre - sel - _gluten de blé_ - levure - huile de tournesol) - tzatziki 37%* (_fromage frais_ 27,4%* - concombre 5,2%* - huile de colza - amidon transformé de pomme de terre - jus de citron - sel - ciboulette - ail - aneth) - _saumon_ fumé 12,3%* [_saumon_ (Salmo salar) - sel] - persil. *Pourcentages exprimés sur le mini blini tzatziki et saumon fumé. Canapé fromage frais oeufs de truite et citron sur pain de mie spécial au seigle 23% : _fromage frais_ 52,1%* - pain de mie spécial au _seigle_ 35,6%* [eau - farine de _blé_ - farine de _seigle_ 4,6%* - _beurre_ - _gluten de blé_ - sucre - levure - _lait_ écrémé en poudre - sel - levain de _seigle_ dévitalisé - farine d\'_orge_ maltée toastée - agent de traitement de la farine : acide ascorbique - huile de tournesol] - _œufs de truite_ 4,9%* (_œufs de truite_ 4,7%* - sel) - graines de pavot - jus de citron 1,6%* - amidon transformé de pomme de terre - huile de tournesol - sel. *Pourcentages exprimés sur le canapé fromage frais œufs de truite et citron. Canapé mousse de canard au Porto et noisette grillée sur pain de mie spécial noir 20,7% : mousse de canard au Porto 55,3%* [graisse de canard 16,5%* - foie maigre de canard 16,5%* - eau - foie g