VALUES ('3222476843005', '30 Mini feuilletés saveurs du Sud - Tomate & basilic, olives noires, épinards & ricotta, fromages fondus', 'Mini feuilleté garni de purée de tomates et basilic 26,9% : Pâte feuilletée dorée 55%* (farine de _blé_ - _beurre_ - eau - sel - _gluten de blé_ - _lactose_ - _crème_ en poudre - _œufs_ en poudre - protéines de _lait_) - eau - purée de tomates mi-réduite 12,9%* - _lactosérum_ en poudre - amidons transformés de pomme de terre - purée de tomates double concentrée 1,7%* - _emmental_ - _œufs_ en poudre - _fromages fondus_ (_fromages_ - eau - sels de fonte : phosphates de sodium, polyphosphates - sel) - tomate en poudre 0,3%* - sel - arôme naturel (contient _lait_) - basilic déshydraté 0,1%* - maltodextrine - dextrose - ail déshydraté - poivre - extraits d\'ail et de thym - oignons déshydratés - _lactose_ - _crème_ en poudre - _lait_ écrémé en poudre - farine de _blé_ - muscade. (*Pourcentages exprimés sur le mini feuilleté garni de purée de tomates et basilic).  Mini feuilleté garni d\'olives noircies par oxydation, câpres et filets d\'anchois salés 24,9% : Pâte feuilletée dorée 70%* (farine de _blé_ - _beurre_ - eau - sel - _gluten de blé_ - _lactose_ - _crème_ en poudre - _œufs_ en poudre - protéines de _lait_) - olives noircies par oxydation 17,9%* (olives noires 9%* - eau - sel - stabilisant : gluconate ferreux) - _lactosérum_ en poudre - _graines de sésame_ blanc - câpres surfines au vinaigre 1%* (câpres 0,5%* - eau - sel - vinaigre) - morceaux de filets d\'_anchois_ salés à l\'huile de tournesol 1%* (_anchois_ 0,7%* - huile de tournesol - sel) - huile d\'olive vierge extra - amidon transformé de pomme de terre - _lactose_ - _crème_ en poudre - _lait_ écrémé en poudre - farine de _blé_ - sel - poivre - muscade. (*Pourcentages exprimés sur le mini feuilleté garni d\'olives noircies par oxydation, câpres et filets d\'anchois salés). Mini feuilleté garni d\'épinards et ricotta 24,1% : Pâte feuilletée dorée 60%* (farine de _blé_ - _beurre_ - eau - sel - _gluten de blé_ - _lactose_ - _crème_ en poudre - _œufs_ en poudre - protéines de _lait_) - épinards 16,7%* - _ricotta_ 15%* (_lactosérum_ - _lait_ - acidifiant : acide citrique) -  _lactosérum_ en poudre - amidon transformé de pomme de terre - arôme naturel (contient _lait_) - _œufs_ en poudre - _lactose_ - _crème_ en poudre - _lait_ écrémé en poudre - sel - farine de _blé_ - poivre - muscade. (*Pourcentages exprimés sur le mini feuilleté garni d\'épinards et ricotta). Mini feuilleté garni de fromages fondus 24,1% : Pâte feuilletée dorée 65%* (farine de _blé_ - _beurre_ - eau - sel - _gluten de blé_ - _lactose_ - _crème_ en poudre - _œufs_ en poudre - protéines de _lait_) - eau - _fromages fondus_ 9,1%* (_fromages_ - eau - sels de fonte : phosphates de sodium, polyphosphates - sel) - _emmental_ râpé  (_emmental_ - amidon de pomme de terre) - amidons transformés de pomme de terre - _lactosérum_ en poudre - arôme naturel (contient _lait_) - _œufs_ en poudre - _lactose_ - sel - _crème_ en poudre - _lait_ écrémé en poudre - farine de _blé_ - poivre - muscade. (*Pourcentages exprimés sur le mini feuilleté garni de fromages fondus).  Traces de _mollusques_, _crustacés_, _moutarde_, _céleri_, _fruits à coque_ et _soja_.', 'https://static.openfoodfacts.org/images/products/322/247/684/3005/front_fr.4.400.jpg', '14', '8.9', '27', '3.1', '', '5.6', '1', '0.393700787401575', '', '1');

