VALUES ('3222477003477', 'Colin d\'Alaska à la bordelaise surgelé', '_Colin d\'Alaska_ (Theragra chalcogramma) 55% - oignon 16,5% - _crème_ fraîche - eau - huile de tournesol - chapelure de couverture 1,5% (farine de _blé_ - sucre - huile de tournesol - levure - sel - agent de traitement de la farine : acide ascorbique) - chapelure (farine de _blé_ - sel - poudre à lever : carbonates d\'ammonium - carbonate de calcium - fer - vitamines : B3, B1) - persil 1,1% - vin blanc concentré 0,9% - arôme et arôme de fumée (contient _crustacés_, _poissons_ et _lait_) - sel - arôme naturel de poivre - arôme naturel de citron. Traces de _céleri_, _oeufs_ et _soja_.', 'https://static.openfoodfacts.org/images/products/322/247/700/3477/front_fr.4.400.jpg', '6.9', '2.5', '5.8', '1.4', '0', '10', '0.88', '0.346456692913386', '', '1');

