INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222477046436', 'Saumon sauce au citron', '_Saumon Atlantique_ (Salmo salar) 50% - eau - _crème_ fraîche - échalote 2,9% - _beurre_ - jus de citron à base de concentré 1,9% (jus de citron à base de  concentré - conservateur : disulfite de sodium) - amidons transformés de maïs -  _lait_ entier en poudre - fumet de _poisson_ aromatisé (maltodextrine - sel - farine de _blé_ - _poisson_ en poudre - _céleri-rave_ - poireau - oignon - sucre - extrait de levure - _crème_ en poudre - arôme naturel (contient _poisson_) - huile d\'olive - épice et plante aromatique - _crevette_ en poudre - extrait de vin blanc] - huile de tournesol - vin blanc concentré - sucre - sel - ciboulette 0,1% - arôme naturel - arôme naturel de citron - épaississant : gomme xanthane - arôme naturel de poivre - épices - extrait de curcuma - fécule de pomme de terre - maltodextrine - colorants : extrait de paprika, carmins. Traces d\'_œufs_ et _soja_.', 'https://static.openfoodfacts.org/images/products/322/247/704/6436/front_fr.4.400.jpg', '9.4', '4.7', '3.7', '1.3', '0', '11', '0.43', '0.169291338582677', '', '1');

