VALUES ('3222477051751', 'Mini penne poulet sauce champignon', 'Pates mini penne cuites 46% (eau - semoule de blé dur-huile de tournesol-sel)-crème fraiche légère-émincés de filet de poulet traité en salaison cuit 10%(filet de poulet 8% (arigine: UE) - eau - sel amidon de riz] - eau - champignons de Paris en morceaux 9,2% - oignon-emmental fondu (emmental et autres fromages-eau-beurre sel-épaississant:gomme xanthane) - amidon transformé - pholiote entière 0,7%-pleurote entière 0,7%-shiitake en morceaux 0,7%-beurre - sel - Iait entier en poudre - cèpe déshydraté en granulés 0,3%-persil - huile de tournesol-cèpe en poudre - protéines de lait-extrait de poivre. Traces d\'oeufs Les informations en gras sont destinées aux personnes intolérantes ou allergiques.', 'https://static.openfoodfacts.org/images/products/322/247/705/1751/front_fr.4.400.jpg', '4.5', '2.4', '16', '1', '', '6.4', '0.6', '0.236220472440945', '', '1');

