VALUES ('3222477106376', 'Bûche glacée', 'Eau - lait écrémé réhydraté - sucre - sirop de glucose-fructose - graisse de coprah - sirop de glucose - lactose et protéines de lait - cacao maigre en poudre-chocolat blanc 3,1% (sucre - beurre de cacao - lait entier en poudre - émulsifiant lécithine de soja - arôme naturel de vanille) - copeaux de chocolat noir 2,3% (pâte de cacao - sucre - beurre de cacao - matière grasse laitière anhydre - émulsifiant: lécithine de soja - arôme naturel de vanille) - chocolat au lait 0,8% (sucre - beurre de cacao - lactosérum en poudre matière grasse laitière anhydre - pâte de cacao - lait écrémé en poudre émulsifiants : lécithine de soja, polyricinoléate de polyglycérol)- chocolat noir 0,7% (sUcre - pâte de cacao - beurre de cacao - matière grasse laitière anhydre - émulsifiant: polyricinoléate de polyglycérol) - émulsifiants mono - et diglycérides d\'acides gras, esters lactiques des mono - et diglycérides d\'acides gras - gélifiants: farine de graines de caroube, gomme guar, pectines-copeaux de chocolat blanc 0,4% (sucre - beurre de cacao - lait entier en poudre lactosérum en poudre - lactose - émulsifiant lécithine de soja - arôme naturel de vanille) - lait écrémé concentré - pâte de cacao - plaquette de chocolat blanc 0,3% (sucre - beurre de cacao - lait entier en poudre émulsifiant: lécithine de soja - arôme naturel de vanille)- sel. Traces de gluten, arachides, oeufs et fruits à coque.', 'https://static.openfoodfacts.org/images/products/322/247/710/6376/front_fr.4.400.jpg', '10', '7.9', '28', '24', '', '2.8', '0.16', '0.062992125984252', '', '1');

