VALUES ('3222477186880', 'Poulet tikka massala et son riz basmati', 'Riz basmati cuit 39,6% (eau - riz ) - filet et aiguillettes de poulet 21,6% (origine : UE) - crème légère 13,4% - oignons - eau - lait de coco 3,8% (extrait de coco - stabilisant: gomme xanthane - émulsifiant sucroesters d\'acides gras épaississant carboxyméthyl-cellulose sodique) tomate au jus 2,5% (tomate - jus de tomate) - huile de soja - yaourt - carottes - poivrons rouges - raisins secs 0,6% - oeufs - sel - amidon de mais - plantes aromatiques 0,2% - épices 0,2% fécule de pommes de terre - sucre - jus de citron à base de concentré - stabilisants: gomme guar, gomme xanthane - huile de tournesol - colorant : caroténoides. Traces de céréales contenant du gluten, crustacés, poisson, arachides, fruits à coque, céleri, moutarde, graines de sésame, mollusques.', 'https://static.openfoodfacts.org/images/products/322/247/718/6880/front_fr.4.400.jpg', '8.5', '3.2', '16', '2.1', '', '6.4', '0.7', '0.275590551181102', '', '1');

